import React from 'react';

import { Modal, Button ,Form, Input} from 'antd';

const FormItem = Form.Item;

class Email extends React.Component {
  state = {
    ModalText: '',
    visible: false,
    confirmLoading: false,
  }

  showModal = () => {
    this.setState({
      visible: true,
    });
  }

  handleOk = () => {
    this.setState({
      ModalText: 'The modal will be closed after two seconds',
      confirmLoading: true,
    });
    setTimeout(() => {
      this.setState({
        visible: false,
        confirmLoading: false,
      });
    }, 2000);
  }

  handleCancel = () => {
    console.log('Clicked cancel button');
    this.setState({
      visible: false,
    });
  }

  render() {
    const formItemLayout = {
        labelCol: {
          xs: { span: 24 },
          sm: { span: 8 }
        },
        wrapperCol: {
          xs: { span: 24 },
          sm: { span: 16 }
        }
      };
    const { visible, confirmLoading, ModalText } = this.state;
    return (
      <div>
        <Button type="primary" onClick={this.showModal}>
          Email
        </Button>
        <Modal title="Email"

          visible={visible}
          onOk={this.handleOk}
          confirmLoading={confirmLoading}
          onCancel={this.handleCancel}
        >
          {/* <p>{ModalText}</p> */}
         <Form >
         <FormItem  className='email' style={{width:'100'}}>
             <FormItem label="To" >
             <Input style={{ color: 'rgba(0,0,0,.25)' }} placeholder="example@gmail.com" />
             </FormItem>
             <FormItem label="Subject" >
             <Input style={{ color: 'rgba(0,0,0,.25)' }} placeholder="Subject" />
             </FormItem>

         </FormItem>
         <div id=":af" class="aoD hl" tabindex="1" style="">
             <div id=":93" class="oL aDm">Recipients</div>
             <div id=":ai" class="bgW">
             <span id=":9p" role="button" tabindex="-1" aria-hidden="true" class="bcV" style="visibility:hidden" data-tooltip="Some recipients use services that don't support encryption (click for details)" aria-label="Some recipients use services that don't support encryption (click for details)"></span></div></div>

         </Form>
        </Modal>
      </div>
    );
  }
}

export default Email;
